import { Link } from "react-router-dom";

const DUMMY = [
  {
    id: "a1",
    title: "some event",
  },
  {
    id: "a2",
    title: "second event",
  },
];

function Event() {
  return (
    <>
      <h1>Event</h1>
      <ul>
        {DUMMY.map((e) => (
          <li key={e.id}>
            <Link to={e.id}>{e.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}

export default Event;
